import React from 'react'
import {NavLink} from 'react-router-dom'
import s from './Header.module.css'

function Header() {
    return (
        <div>
            {/*// add NavLinks*/}
            <NavLink to={'/'} className={s.nav_linck}>pre-junior</NavLink>
            <NavLink to={'/zalupa'} className={s.nav_linck}>junior</NavLink>
            <NavLink to={'/zalupa+'} className={s.nav_linck}>junior+</NavLink>
            <div></div>
        </div>
    )
}

export default Header
